edition = "2023";

package apps.people.oz.external.mergedpeopleapi;

option objc_class_prefix = "POEM";

message ChannelData {
	string channel_id = 1;
	int64 subscriber_count = 2;
	string description = 3;
	int64 video_count = 4;
	int64 playlist_count = 5;
	int64 comment_count = 6;
	string profile_url = 7;
	bool uses_youtube_names = 8;
	string title = 9;
	string profile_picture_url = 10;
}
